INSERT INTO "public"."surveys" VALUES (3, 'CTI Questionnaire/Sufian', '{
 "title": "Critical Thinking & Innovation",
 "description": "The Critical Thinking and Innovation (CTI) questionnaire elicits your opinion regarding critical thinking and innovation importance and practice in K-12 instruction. This is a voluntary task whose results will add valuable recommendations to CT and Innovation teaching and learning. You may withdraw at anytime and you don''t have to reveal your name. For any inquiries, pls, email me at sufian.forawi@buid.ac.ae. Thanks",
 "pages": [
  {
   "name": "page1"
  }
 ]
}', '095ff2de-50ce-11eb-a07c-bf277141b12d', 'f', 'f', 't', '2021-01-08 12:49:51.533416+00', '2021-01-08 12:49:51.533416+00', NULL, 'f');
INSERT INTO "public"."surveys" VALUES (10, 'Dubai Car (car-sharing) Service Survey', '{
 "logo": "data:image/jpeg;base64,",
 "pages": [
  {
   "name": "page1",
   "elements": [
    {
     "type": "radiogroup",
     "name": "question1",
     "title": "Place of interview",
     "choices": [
      "Exhihition Centre",
      "Metro station",
      "Shk Zayed road",
      "Jebel Ali / Ibn Batuta area",
      "Jumeira Lake Towers/Dubai Marina area",
      "Downtown Dubai/ Dubai Mall Area",
      "Central Business District (Deira/ Burdubai Area)",
      "Al Nada / Qusais Area"
     ]
    },
    {
     "type": "radiogroup",
     "name": "question2",
     "title": "How often do you use the Dubai Car service?",
     "choices": [
      "Daily",
      "Weekly",
      "Monthly",
      "On rare occasions",
      "Other (please specify)"
     ]
    },
    {
     "type": "checkbox",
     "name": "question4",
     "visibleIf": "{question1} = ''Exhihition Centre''",
     "title": "Which Dubai Car (car-sharing) company do you use? ",
     "category": "41941c1a-22bc-11eb-9a15-f373ab1dea85",
     "choices": [
      "Ekar",
      "Udrive"
     ]
    },
    {
     "type": "dropdown",
     "name": "question5",
     "title": "What is the average time it takes you to get the Dubai Car? ",
     "category": "d0aca736-26af-11eb-9a15-f373ab1dea85",
     "choices": [
      "1 - 10 minutes",
      "11-20 minutes",
      "21- 30 minutes",
      "31- 45 minutes",
      "45 - 60 minutes",
      "More than an hour"
     ],
     "hasOther": true
    },
    {
     "type": "matrix",
     "name": "question6",
     "visibleIf": "{question4} = [''Ekar'']",
     "title": "Ease of getting the service ",
     "category": "7ad1596a-1fb1-11eb-ba90-036f9a94cfa2",
     "columns": [
      {
       "value": "1",
       "score": 5
      },
      {
       "value": "2",
       "score": 4
      },
      {
       "value": "3",
       "score": 3
      },
      {
       "value": "4",
       "score": 2
      },
      {
       "value": "5",
       "score": 1
      }
     ],
     "rows": [
      "In general, there is no difficulty to get a Dubai Car. ",
      "It is easy to obtain information about the service. ",
      "There was no contradiction in the service information. ",
      "The fee is reasonable and worth the service I am getting. ",
      "The payment method is convenient to me. ",
      "It was clear to me what to do in case I encounter a problem while receiving the service. "
     ]
    },
    {
     "type": "radiogroup",
     "name": "question7",
     "title": "How satisfied are you with the ease of getting the Dubai Car in general",
     "choices": [
      {
       "value": "Extremely Satisfied",
       "score": 5
      },
      {
       "value": "Satisfied",
       "score": 4
      },
      {
       "value": "Neutral",
       "score": 3
      },
      {
       "value": "Dissatisfied",
       "score": 2
      },
      {
       "value": "Extremely dissatisfied",
       "score": 1
      }
     ]
    },
    {
     "type": "matrixdropdown",
     "name": "question3",
     "title": "General Trust Level ",
     "columns": [
      {
       "name": "a"
      },
      {
       "name": "b"
      },
      {
       "name": "c"
      }
     ],
     "choices": [
      {
       "value": "A",
       "score": 7
      },
      {
       "value": "B",
       "score": 6
      },
      {
       "value": "C",
       "score": 5
      },
      {
       "value": "D",
       "score": 4
      },
      {
       "value": "E",
       "score": 3
      },
      {
       "value": "F",
       "score": 2
      },
      {
       "value": "G",
       "score": 1
      }
     ],
     "rows": [
      "A1",
      "B1"
     ]
    },
    {
     "type": "comment",
     "name": "question9",
     "title": "Overall Comments"
    }
   ]
  }
 ],
 "showTitle": false
}', '095ff2de-50ce-11eb-a07c-bf277141b12d', 'f', 'f', 't', '2021-01-10 02:10:02.356148+00', '2021-01-10 02:10:02.356148+00', NULL, 'f');
