     "rows": [
      "تحرص القيادة العليا في المؤسسة على التواصل مع الموظفين والتحاور معهم ومساندتهم ",
      "القيادة العليا في المؤسسة ملتزمة بالقيام بكل ما من شأنه أن يقود المؤسسة للنجاح على المدى القريب والبعيد ",
      "القيادة العليا في المؤسسة على استعداد دائم لاعتماد أي أساليب أو مبادرات من شانها تطوير اداء الموظفين ",
      "تتجاوب المؤسسة مع احتياجات ومتطلبات الموظفين التي تتغير باستمرار ",
      "تشجع القيادة العليا على المشاركة الفعالة للموظفين في احداث وادارة التغيير في المؤسسة ",
      "يحرص فريق القيادة في الادارة / المؤسسة / القطاع على التواصل مع الموظفين والتحاور معهم ومساندتهم "
     ]
    },
    {
