     ],
     "rows": [
      "يشيد مسؤولي المباشر بأدائي ويقدره عندما اقوم بعملي بشكل جيد ",
      "يقدم مديري المباشر ملاحظاته على أدائي الوظيفي باستمرار لمساعدتي على التطور وتحسين أدائي ",
      "تلتزم المؤسسة بتوفير التدريب وفرص التطور لموظفيها ",
      "يساهم تقييم الآداء السنوي في معرفة التوقعات المتعلقة بأدائي ",
      "الوصف الوظيفي الخاص بي دقيق ومرتبط عمليا بطبيعة المهام التي اقوم بها ",
      "توفر المؤسسة دليل المسار الوظيفي لموظفيها. . (ملاحظة: من الدرجة 8 فما فوق بإستثناء المدراء التنفيذيين) ",
